In the main.lua file of your mod, write some code that will try to access the objects of Unreal Engine inside your target game and do something that you can observe in the UE4SS console. You can start by trying just print("[MyLuaMod] Mod loaded
") and once you have verified that it runs OK, you can start implementing some actual functionality. The example code below is fairly generic and should work for many games supported by UE4SS. It registers a hotkey Ctrl+F1 and when pressed, it reads the player coordinates and calculates how far the player has moved since the last time the hotkey was pressed. Note that the logging print calls include the name of the mod in square brackets, as it helps you find your mod's output among other log strings in the console. The player coordinates are retrieved in the following way: Gets the player controller using UE4SS UEHelpers class. Get the Pawn, which represents the actual "physical" entity that the player can control in Unreal Engine. Call the appropriate Unreal Engine method K2_GetActorLocation that returns a Pawn's location (by accessing its parent Actor class). The location is a 3-component vector of Unreal Engine type FVector, having X, Y and Z as its fields. local UEHelpers = require("UEHelpers") print("[MyLuaMod] Mod loaded
") local lastLocation = nil function ReadPlayerLocation() local FirstPlayerController = UEHelpers:GetPlayerController() local Pawn = FirstPlayerController.Pawn local Location = Pawn:K2_GetActorLocation() print(string.format("[MyLuaMod] Player location: {X=%.3f, Y=%.3f, Z=%.3f}
", Location.X, Location.Y, Location.Z)) if lastLocation then print(string.format("[MyLuaMod] Player moved: {delta_X=%.3f, delta_Y=%.3f, delta_Z=%.3f}
", Location.X - lastLocation.X, Location.Y - lastLocation.Y, Location.Z - lastLocation.Z) ) end lastLocation = Location end RegisterKeyBind(Key.F1, { ModifierKey.CONTROL }, function() print("[MyLuaMod] Key pressed
") ExecuteInGameThread(function() ReadPlayerLocation() end) end) When you load the game until you can move the character, press the hotkey, move the player, press it again, the mod will generate a following output or something very similar: ... [2024-01-09 19:37:27] Starting Lua mod 'MyLuaMod' [2024-01-09 19:37:27] [Lua] [MyLuaMod] Mod loaded ... [2024-01-09 19:37:32] [Lua] [MyLuaMod] Key pressed [2024-01-09 19:37:32] [Lua] [MyLuaMod] Player location: {X=-63.133, Y=4.372, Z=90.000} [2024-01-09 19:37:39] [Lua] [MyLuaMod] Key pressed [2024-01-09 19:37:39] [Lua] [MyLuaMod] Player location: {X=788.232, Y=-639.627, Z=90.000} [2024-01-09 19:37:39] [Lua] [MyLuaMod] Player moved: {delta_X=851.364, delta_Y=-643.999, delta_Z=0.000} ...
